BEGIN TRANSACTION;
CREATE TABLE `achievement_category_m` (
    `achievement_category_id` INTEGER NOT NULL,
    `icon_asset` TEXT NOT NULL,
    `start_date` TEXT,
    `end_date` TEXT,
    `display_flag` INTEGER NOT NULL,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`achievement_category_id`)
);
CREATE TABLE `achievement_description_m` (
    `achievement_description_id` INTEGER NOT NULL,
    `achievement_type` INTEGER NOT NULL,
    `common_id` INTEGER NOT NULL,
    `description` TEXT,
    PRIMARY KEY (`achievement_description_id`)
);
CREATE TABLE `achievement_m` (
    `achievement_id` INTEGER NOT NULL,
    `title` TEXT NOT NULL,
    `description` TEXT,
    `icon_asset` TEXT NOT NULL,
    `stage_level` INTEGER NOT NULL,
    `achievement_type` INTEGER NOT NULL,
    `reset_type` INTEGER NOT NULL,
    `reset_param` INTEGER,
    `params1` INTEGER,
    `params2` INTEGER,
    `params3` INTEGER,
    `params4` INTEGER,
    `params5` INTEGER,
    `params6` INTEGER,
    `params7` INTEGER,
    `params8` INTEGER,
    `params9` INTEGER,
    `params10` INTEGER,
    `params11` INTEGER,
    `start_date` TEXT NOT NULL,
    `end_date` TEXT,
    `default_open_flag` INTEGER NOT NULL,
    `display_flag` INTEGER NOT NULL,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`achievement_id`)
);
CREATE TABLE `achievement_story_m` (
    `achievement_id` INTEGER NOT NULL,
    `next_achievement_id` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_id`,`next_achievement_id`)
);
CREATE TABLE `achievement_tag_m` (
    `achievement_id` INTEGER NOT NULL,
    `achievement_category_id` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_id`,`achievement_category_id`)
);
CREATE TABLE `achievement_unit_group_m` (
    `achievement_unit_group_id` INTEGER NOT NULL,
    `unit_id` INTEGER NOT NULL,
    `rank` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_unit_group_id`,`unit_id`)
);
CREATE TABLE `achievement_unit_group_name_m` (
    `achievement_unit_group_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    PRIMARY KEY (`achievement_unit_group_id`)
);
CREATE TABLE `achievement_unit_type_group_m` (
    `achievement_unit_type_group_id` INTEGER NOT NULL,
    `unit_type_id` INTEGER NOT NULL,
    `rank` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_unit_type_group_id`,`unit_type_id`)
);
CREATE TABLE `achievement_unit_type_group_name_m` (
    `achievement_unit_type_group_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    PRIMARY KEY (`achievement_unit_type_group_id`)
);
COMMIT;
